import React, { useEffect, useState } from 'react';
import './App.css';

const App = () => {
  const [userData, setUserData] = useState(null);

  useEffect(() => {
    fetch('https://randomuser.me/api/?page=1&results=1&seed=abc')
      .then((response) => response.json())
      .then((data) => setUserData(data.results[0]))
      .catch((error) => console.error('Error fetching data:', error));
  }, []);

  const handlePhoneNumberClick = (phoneNumber) => {
    window.location.href = `tel:${phoneNumber}`;
  };

  const handleEmailClick = (email) => {
    window.location.href = `mailto:${email}`;
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-gray-100">
      {userData && (
        <div className="max-w-md w-full mx-auto bg-white p-8 rounded-lg shadow-md">
          <div className="flex items-center justify-between">
            <div className="flex items-center">
              <img
                className="w-16 h-16 object-cover rounded-full"
                src={userData.picture.large}
                alt="User"
              />
              <div className="ml-4">
                <h2 className="text-xl font-bold">
                  {`${userData.name.title} ${userData.name.first} ${userData.name.last}`}
                </h2>
                <p className="text-gray-600">{userData.email}</p>
              </div>
            </div>
            <div className="flex items-center space-x-2">
              <button
                className="bg-blue-500 text-white px-4 py-2 rounded-full"
                onClick={() => handleEmailClick(userData.email)}
              >
                Message
              </button>
              <button
                className="bg-green-500 text-white px-4 py-2 rounded-full"
                onClick={() => handlePhoneNumberClick(userData.phone)}
              >
                Connect
              </button>
            </div>
          </div>
          <div className="mt-4">
            <p className="text-gray-800">{`${userData.location.street.number} ${userData.location.street.name}, ${userData.location.city}, ${userData.location.state}, ${userData.location.country} ${userData.location.postcode}`}</p>
          </div>
          <div className="mt-4">
            <p className="text-gray-600">
              {`Date of Birth: ${userData.dob.date}, Age: ${userData.dob.age}`}
            </p>
            <p className="text-gray-600">
              <span
                className="text-blue-500 hover:underline cursor-pointer"
                onClick={() => handlePhoneNumberClick(userData.phone)}
              >
                Phone: {userData.phone}
              </span>
              {', '}
              <span
                className="text-blue-500 hover:underline cursor-pointer"
                onClick={() => handlePhoneNumberClick(userData.cell)}
              >
                Cell: {userData.cell}
              </span>
            </p>
          </div>
        </div>
      )}
    </div>
  );
};

export default App;
